B.zr=new A.aQ("Wi-Fi","Persistent connection with your Tesla","### As a result of introducing the new Offline Mode Wi-Fi stability and connection times have been significantly improved.\n### If you use the (now optional) LTE modem to get a full Android experience your Wi-Fi with the car won't disconnect when there is no LTE coverage(highways, underground parking etc)")
B.zP=new A.aQ("Virtual display","Quality improvements","### Video stream quality has been slightly improved after reducing the image compression.")
B.zB=new A.aQ("Flutter Frontend","Stability improvements","### Flutter Frontend has been updated in order to improve user experience.\n### Framework version has been bumped to 3.0.4. Rendering engine has been switched to HTML from CanvasKit due to problems with offline loading in Flutter.")
